import './App.css';
import React, { Component } from 'react';
 class App extends Component {
  state={
    nom:'Mohammed',
    age:20,
  }
  aficher(){
    <h1>
    {this.state.nom} {this.state.age}
    </h1>
    
  }
  render() {
    return (
      <div>
        {this.aficher}
      </div>
    )
  }
}
export default App











